import React from "react";
import EventNoteTwoToneIcon from '@mui/icons-material/EventNoteTwoTone';

function Heading (){
    return(<header>
        <h1><EventNoteTwoToneIcon /> Keeper</h1>
    </header>);
}

export default Heading;
